import React from "react";
import {BoxPicture} from "../styles/components/BoxPicture/BoxPicture.styled";
import img from '../images/bg.jpg'


function Picture() {
	return (
		<BoxPicture>
			<img src={img} alt={'picture'}/>
		</BoxPicture>
	)
}

export default Picture;
